Six éléments du portfolio sur trois feuilles pliées en deux :
Sur la première feuille pliée en deux : 
une page de faux-titre ;
un sommaire du portfolio ;
un "sommaire" des diverses publications.
Sur la seconde feuille pliée en deux : 
une page de titre ;
un justificatif de tirage, numéroté et signé 72/75 Suzanne Valadon ;
Sur la troisième feuille pliée en deux : 
une préface de Claude Roger Marx "L'oeuvre gravé de Suzanne Valadon" (4 feuillets)
Typographie sur papier vélin
